们走。<p></p>vi.<p></p>离去，离开；出发，动身：<p></p>离去，离开；出发，动身：<p></p>When we got to the railway station, the train had left.<p></p>我们到火车站时，火车已经开走了。<p></p>He leaves for work at 7 every morning.<p></p>他每天早上7点钟离家去上班。<p></p>短语:<p></p>be(或get)(nicely) left<p></p>[口语]<p></p>被击败；遭遗弃<p></p>受骗，上当<p></p>be left for dead<p></p>被认为已死亡而舍弃；…被认为无可救药<p></p>be left with<p></p>给留下…；被剩下…<p></p>be well left<p></p>得大笔遗产<p></p>leave a strip<p></p>[俚语]突然刹车；突然减速<p></p>leave go (或 loose)of something<p></p>[口语]松手放开…；撒手；舍弃…<p></p>leave hold of<p></p>松手；放开<p></p>leave in the air<p></p>搁置；暂不解决<p></p>leave it at that<p></p>[口语]行啦；就这样好了；到此为止吧<p></p>leave it out<p></p>停止(吵闹、咒骂、抱怨等)；得啦；别吵啦<p></p>leave much (或 a lot, a great deal) to be desired<p></p>极不完善；还有待改进<p></p>leave no avenue unexplored<p></p>想尽一切办法；探索各种途径<p></p>leave no means untried<p></p>用尽一切方法<p></p>leave nothing to be desired<p></p>完美无缺<p></p>leave nothing unsaid<p></p>和盘托出<p></p>leave one holding the sack<p></p>让某人背黑锅<p></p>leave one's affairs in order<p></p>把某人的事理顺<p></p>leave out of account (或 consideration, reckoning)<p></p>不加考虑；不去注意<p></p>leave someone flat<p></p>断然抛弃某人；突然离开某人<p></p>leave someone (或something) in someone's care (或 charge)<p></p>把某人(或某物)交由某人照管<p></p>leave (someone 或 something) standing<p></p>[俚语]远远超过(某人或某物)；大大优于(某人或某物)<p></p>leave (或 give) someone the bag to hold<p></p>让某人担全部责任；把责任推给某人<p></p>让某人一无所有<p></p>leave someone to himself (或 to his own devices, to his own resources, to sink or swim)<p></p>听其自然；任其自由行动；听任某人自行其是；对某人不加干涉<p></p>leave someone to it<p></p>[口语]听任某人自己做某事；让某人自个儿继续做某事<p></p>leave something as it is<p></p>听其自然；听任某事自然发展<p></p>leave something to be desired<p></p>尚不令人满意；不够完美<p></p>leave something to chance<p></p>让某事去碰运气<p></p>leave visiting cards<p></p>[英国俚语](飞机)投弹<p></p>leave (或 let) well (enough) alone<p></p>知足；满足现状；不要去管；不要弄巧成拙<p></p>leave word at<p></p>留下口信；在…留言<p></p>leave word for<p></p>为…留言<p></p>to be left until called for<p></p>(邮件等)留局待领<p></p>变形：<p></p>vt.<p></p>left<p></p>. leaving</p></body></html>",
